def transformNull(word,tipo):
    word=str(word)
    if word in ['NULL','None','@','+','*','',',']:
        return '?'
    else:
        if tipo==1:
            return "'"+word+"'"
        else:
            return word
        
def transformTrabajo(word):
    word=str(word)
    if word in ['0','N']:
        return "'N'"
    if  word in ['S','1','2','3','4','5','6','7']:
        return "'S'"
    else:
        return '?'

def transformEdad(word):
    try:
        word = int(word)
        if ((word<81)and(word>5)):
            return str(word)
        else:
            return '?'

    except ValueError:

        return '?'

    except TypeError:

        return '?'
    
